import React from 'react'
import { FormControl } from '@mui/material';
import { InputLabel } from '@mui/material';

import TextField from '@mui/material/TextField';

export default function NewArticleForm() {
  return (
    <div>
        <TextField
             label="Standard" 
             variant="standard" 
             sx={{
                 width:"100^"
             }}
        />
    </div>
  )
}
